                            value=Constant(lineno=284, col_offset=23, end_lineno=320, end_col_offset=11, value='\n        GROUP BY sub.move_id,\n            sub.account_move_id,\n            sub.name,\n            sub.state,\n            sub.partner_id,\n            sub.date,\n            sub.l10n_in_gst_treatment,\n            sub.ecommerce_partner_id,\n            sub.shipping_bill_number,\n            sub.shipping_bill_date,\n            sub.shipping_port_code_id,\n            sub.total,\n            sub.journal_id,\n            sub.company_id,\n            sub.move_type,\n            sub.reversed_entry_id,\n            sub.partner_vat,\n            sub.ecommerce_vat,\n            sub.place_of_supply,\n            sub.is_pre_gst,\n            sub.is_ecommerce,\n            sub.b2cl_is_ecommerce,\n            sub.b2cs_is_ecommerce,\n            sub.supply_type,\n            sub.export_type,\n            sub.refund_export_type,\n            sub.b2b_type,\n            sub.refund_invoice_type,\n            sub.gst_format_date,\n            sub.gst_format_refund_date,\n            sub.gst_format_shipping_bill_date,\n            sub.amount_sign,\n            sub.tax_id,\n            sub.tax_rate,\n            sub.b2cs_refund_sign\n        ', kind=None),
